// bufferToWav 함수는 이전과 동일하게 사용합니다.
function bufferToWav(buffer) {
    const numOfChan = buffer.numberOfChannels;
    const length = buffer.length * numOfChan * 2 + 44;
    const bufferData = new ArrayBuffer(length);
    const view = new DataView(bufferData);
    let pos = 0;

    // WAV 헤더 작성 함수들
    const setUint16 = (data) => { view.setUint16(pos, data, true); pos += 2; };
    const setUint32 = (data) => { view.setUint32(pos, data, true); pos += 4; };

    setUint32(0x46464952); // "RIFF"
    setUint32(length - 8); // 파일 크기
    setUint32(0x45564157); // "WAVE"
    setUint32(0x20746d66); // "fmt "
    setUint32(16);         // 청크 크기
    setUint16(1);          // PCM
    setUint16(numOfChan);
    setUint32(buffer.sampleRate);
    setUint32(buffer.sampleRate * 2 * numOfChan);
    setUint16(numOfChan * 2);
    setUint16(16);         // 16비트
    setUint32(0x61746164); // "data"
    setUint32(length - pos - 4);

    // 오디오 데이터 쓰기
    for (let i = 0; i < buffer.length; i++) {
        for (let channel = 0; channel < numOfChan; channel++) {
            let sample = buffer.getChannelData(channel)[i];
            sample = Math.max(-1, Math.min(1, sample)); // 클리핑 방지
            sample = (sample < 0 ? sample * 0x8000 : sample * 0x7FFF) | 0;
            view.setInt16(pos, sample, true);
            pos += 2;
        }
    }

    return new Blob([bufferData], { type: "audio/wav" });
}

player = null;
player = document.getElementById('player');

document.getElementById('startBtn').onclick = async function() {
    const gapTime = parseInt(document.getElementById('gapInput').value) || 10;
    const debug = document.getElementById('status'); // 상태 표시용

    // [중요] 누르자마자 오디오 컨텍스트를 활성화 (Unlock)
    const audioCtx = new (window.AudioContext || window.webkitAudioContext)();
    if (audioCtx.state === 'suspended') {
        await audioCtx.resume();
    }
    debug.innerText = "단계 1: 데이터 로딩 시작...";
    try {
        // 1. 변수 존재 여부 체크
        if (typeof VOICE_ASSETS === 'undefined') {
            throw new Error("voices.js 파일을 찾을 수 없거나 변수명이 다릅니다.");
        }
    } catch (e) {
        debug.innerText = "❌ 오류 발생: " + e.message;
        console.error(e);
    }


    // 1. VOICE_ASSETS에서 단어 키값만 가져와 셔플
    const words = Object.keys(VOICE_ASSETS);
    const shuffled = words.sort(() => Math.random() - 0.5);
    
    const decodedBuffers = [];
    let totalDuration = 0;
    debug.innerText = "단계 2: 2데이터 로딩 시작...";
    for (const word of shuffled) {
        const base64 = VOICE_ASSETS[word];
        // Base64를 ArrayBuffer로 변환
        const resp = await fetch(base64); // data-uri fetch는 CORS 영향을 받지 않음
        const arrayBuf = await resp.arrayBuffer();
        const audioBuf = await audioCtx.decodeAudioData(arrayBuf);
        
        decodedBuffers.push(audioBuf);
        totalDuration += audioBuf.duration + gapTime;
    }

    debug.innerText = "단계 2: 오프라인 병합...";
    // 2. 오프라인 병합 (이전 로직과 동일)
    const offlineCtx = new OfflineAudioContext(1, audioCtx.sampleRate * totalDuration, audioCtx.sampleRate);
    let currentTime = 0;
    decodedBuffers.forEach(buf => {
        const source = offlineCtx.createBufferSource();
        source.buffer = buf;
        source.connect(offlineCtx.destination);
        source.start(currentTime);
        currentTime += buf.duration + gapTime;
    });

    debug.innerText = "단계 3: 합성 완료, 재생 시도";
    const finalBuffer = await offlineCtx.startRendering();
    const wavBlob = bufferToWav(finalBuffer);

    
    player.src = URL.createObjectURL(wavBlob);
    player.play();

};

if ('mediaSession' in navigator) {
        // 재생 제어권 등록
        navigator.mediaSession.setActionHandler('play', () => player.play());
        navigator.mediaSession.setActionHandler('pause', () => player.pause());
        // 원하신다면 앞/뒤 이동도 추가
        navigator.mediaSession.setActionHandler('seekbackward', () => player.currentTime -= 10);
        navigator.mediaSession.setActionHandler('seekforward', () => player.currentTime += 10);
}
// 버튼 클릭 시에는 재생만 시키고, 
// 실제 미디어 세션 정보는 오디오가 '진짜로' 시작될 때 업데이트합니다.
player.onplay = () => {
    if ('mediaSession' in navigator) {
        navigator.mediaSession.metadata = new MediaMetadata({
            title: '나의 운동 루틴',
            artist: '운동 보이스 타이머',
            album: 'Daily Workout',
            artwork: [
                { src: 'https://placehold.co/96x96.png?text=RopeFlow', sizes: '96x96', type: 'image/png' },
                { src: 'https://placehold.co/512x512.png?text=RopeFlow', sizes: '512x512', type: 'image/png' }
            ]
        });
        navigator.mediaSession.playbackState = "playing";
    }
};

player.onpause = () => {
    if ('mediaSession' in navigator) {
        navigator.mediaSession.playbackState = "paused";
    }
};

</script>
